import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

const image="././images/user-2.png">


ReactDOM.render(

  <>
  <h1>hello world</h1>
  <img src={image} alt="title"/>
  <img src="././images/user-1.png" alt="image" className="image"/>
  </>,
  document.getElementById('root')
);
